  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0114478 includes chemical,
  discrete sample, physical and profile data collected from NOAA Ship MALCOLM BALDRIGE
  in the Indian Ocean and Laccadive Sea from 1995-09-22 to 1995-10-25 and retrieved
  during cruise WOCE Repeat IR08N (OACES-95). These data include ALKALINITY, CHLOROFLUOROCARBON-11
  (CFC-11), CHLOROFLUOROCARBON-12 (CFC-12), DELTA CARBON-13, DISSOLVED INORGANIC CARBON,
  DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE, NITRITE, NITROGEN - ORGANIC, PHOSPHATE,
  Partial pressure (or fugacity) of carbon dioxide, Potential temperature (theta),
  SALINITY, SILICATE, Total Organic Carbon (TOC), WATER TEMPERATURE and pH. The instruments
  used to collect these data include CTD and bottle. These data were collected by
  Dennis Hansell and Frank J. Millero of Rosenstiel School of Marine and Atmospheric
  Science and Rik Wanninkhof of US DOC; NOAA; OAR; Atlantic Oceanographic and Meteorological
  Laboratory as part of the WOCE_IR08N_OACES-95 data set.nnThe World Ocean Circulation
  Experiment (WOCE) was a major component of the World Climate Research Program with
  the overall goal of better understanding the ocean's role in climate and climatic
  changes resulting from both natural and anthropogenic causes. The CO2 survey took
  advantage of the sampling opportunities provided by the WOCE Hydrographic Program
  (WHP) cruises during this period between 1990 and 1998. The final collection covers
  approximately 23,000 stations from 94 WOCE cruises.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
